import React from "react";
import { Routes, Route } from "react-router-dom";
import AboutPage from "../pages/AboutPage";
import ContactPage from "../pages/ContactPage";
import HomePage from "../pages/HomePage";
import HizmetPage from "../pages/HizmetPage";
import SorularPage from "../pages/SorularPage";
import BBGlowPage from "../pages/BBGlowPage";
import DuadakRenklendirmePage from "../pages/DuadakRenklendirmePage";
import KasKirpikPage from "../pages/KasKirpikPage";
import MicrobladingPage from "../pages/MicrobladingPage";
import PudralamaPage from "../pages/PudralamaPage";
import EyelineDiplinerPage from "../pages/EyelineDiplinerPage";
import MakyajSilmePage from "../pages/MakyajSilmePage";
import EgitimEyelinerDiplinerPage from "../pages/EgitimEyelinerDiplinerPage";
import EgitimMicrobladingPage from "../pages/EgitimMicrobladingPage";
import EgitimKasSilmePage from "../pages/EgitimKasSilmePage";
import EgitimKasKirpikLiftingPage from "../pages/EgitimKasKirpikLiftingPage";
import EgitimDudakRenklendirmePage from "../pages/EgitimDudakRenklendirmePage";
import EgitimPage from "../pages/EgitimPage";

const CustomRoutes = () => {
  return (
    <Routes>
      <Route
        exact
        path="/EgitimDudakRenklendirme"
        element={<EgitimDudakRenklendirmePage />}
      />

      />
      <Route path="/Egitim" element={<EgitimPage />} />
      <Route path="/Contact" element={<ContactPage />} />
      <Route path="/About" element={<AboutPage />} />
      <Route path="/Hizmet" element={<HizmetPage />} />
      <Route path="/" element={<HomePage />} />
    </Routes>
  );
};

export default CustomRoutes;
